sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        var jsonObj = JSON.parse(inputs.req);
        if (!jsonObj.persons || !Array.isArray(jsonObj.persons)) {
            throw new Error("persons array is missing or invalid.");
        }
        var persons = jsonObj.persons;
        var res = persons.map(function(element) {
            if (!element.Name) {
                throw new Error("Name field is missing for a person.");
            }
            if (!element.Type) {
                throw new Error("Type field is missing for a person.");
            }
            if (!Array.isArray(element.Documents)) {
                throw new Error("Documents array is missing or invalid for a person.");
            }
            var documents = element.Documents.map(function(doc) {
                if (!doc.docbyteArray || !doc.docName || !doc.docType || !doc.fileExtension || !doc.docshortName) {
                    throw new Error("One or more document fields are missing.");
                }
                return {
                    BodyString: doc.docbyteArray,
                    Name: doc.docName,
                    Type: doc.docType,
                    FileExt: doc.fileExtension,
                    ShortName: doc.docshortName
                };
            });
            return {
                Name: element.Name,
                Type: element.Type,
                Documents: documents
            };
        });
        var inputRequest = {
            Persons: res
        };
        outputs.response = JSON.stringify(inputRequest);
    } catch (error) {
 
        gs.error("Error processing request: " + error.message);
        outputs.response = JSON.stringify({ error: error.message });
    }
})(inputs, outputs);

